// import { Button } from "semantic-ui-react";
import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from "react-router-dom";
// import AuthService from "../services/auth.service";


class Header extends Component {


    constructor(props) {
        super(props);

        this.state = {
            //   showModeratorBoard: false,
            //   showAdminBoard: false,
            //   currentUser: undefined
        };
    }
    state = {
        navigate: false
    };

    componentDidMount() {

        //user  stored user information (including JWT) from AuthService class
        // const user = AuthService.getCurrentUser();

        // if (user) {
        //   this.setState({
        //     currentUser: user,
        //     showModeratorBoard: user,
        //     showAdminBoard: user
        //   });
        // }
    }


    logout = () => {


        // localStorage.clear("user");
        // this.setState({ navigate: true});
        // window.location.reload("/");
    };

    render() {
        // const { currentUser, showModeratorBoard, showAdminBoard } = this.state;
        // const { navigate } = this.state;

        //    if (navigate){ 
        //          return <Redirect to="/" push={true} />;


        //         }


        return (

            <Router>
                {/* {currentUser && ( */}


                <div id="kt_header" className="header flex-column header-fixed">
                    {/*begin::Top*/}
                    <div className="header-top">
                        {/*begin::Container*/}
                        <div className="container">
                            {/*begin::Left*/}
                            <div className="d-none d-lg-flex align-items-center mr-3">
                                {/*begin::Logo*/}
                                <a href="index.html" className="mr-20">
                                    <img alt="Logo" src="assets/media/logos/logo-letter-9.png" className="max-h-35px" />
                                </a>
                                {/*end::Logo*/}
                                {/*begin::Tab Navs(for desktop mode)*/}
                                <ul className="header-tabs nav align-self-end font-size-lg" role="tablist">
                                    {/*begin::Item*/}
                                    <li className="nav-item">
                                        <a href="#" className="nav-link py-4 px-6 active" data-toggle="tab" data-target="#kt_header_tab_1" role="tab">Home</a>
                                    </li>
                                    {/*end::Item*/}
                                    {/*begin::Item*/}
                                    <li className="nav-item mr-3">
                                        <a href="#" className="nav-link py-4 px-6" data-toggle="tab" data-target="#kt_header_tab_2" role="tab">Reports</a>
                                    </li>
                                    {/*end::Item*/}
                                    {/*begin::Item*/}
                                    <li className="nav-item mr-3">
                                        <a href="#" className="nav-link py-4 px-6" data-toggle="tab" data-target="#kt_header_tab_2" role="tab">Orders</a>
                                    </li>
                                    {/*end::Item*/}
                                    {/*begin::Item*/}
                                    <li className="nav-item mr-3">
                                        <a href="#" className="nav-link py-4 px-6" data-toggle="tab" data-target="#kt_header_tab_2" role="tab">Help Ceter</a>
                                    </li>
                                    {/*end::Item*/}
                                </ul>
                                {/*begin::Tab Navs*/}
                            </div>
                            {/*end::Left*/}

                        </div>
                        {/*end::Container*/}
                    </div>
                    {/*end::Top*/}
                    {/*begin::Bottom*/}
                    <div className="header-bottom">
                        {/*begin::Container*/}
                        <div className="container">
                            {/*begin::Header Menu Wrapper*/}

                                {/*begin::Tab Content*/}
                                <div className="tab-content">
                                    {/*begin::Tab Pane*/}
                                    <div className="tab-pane py-5 p-lg-0 show active" id="kt_header_tab_1">
                                        {/*begin::Menu*/}
                                        <div id="kt_header_menu" className="header-menu header-menu-mobile header-menu-layout-default">
                                            {/*begin::Nav*/}
                                            <ul className="menu-nav">
                                                <li className="menu-item menu-item-active" aria-haspopup="true">
                                                    <a href="index.html" className="menu-link">
                                                        <span className="menu-text">Dashboard</span>
                                                    </a>
                                                </li>
                                                <li className="menu-item menu-item-submenu menu-item-rel" data-menu-toggle="click" aria-haspopup="true">
                                                    <a href="javascript:;" className="menu-link menu-toggle">
                                                        <span className="menu-text">Features</span>
                                                        <span className="menu-desc" />
                                                        <i className="menu-arrow" />
                                                    </a>
                                                    <div className="menu-submenu menu-submenu-classic menu-submenu-left">
                                                        <ul className="menu-subnav">
                                                            <li className="menu-item menu-item-submenu" data-menu-toggle="hover" aria-haspopup="true">
                                                                <a href="javascript:;" className="menu-link menu-toggle">
                                                                    <span className="svg-icon menu-icon">
                                                                        {/*begin::Svg Icon | path:assets/media/svg/icons/Communication/Add-user.svg*/}
                                                                        <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
